import React from "react";
import { useNavigate } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';
<link
  rel="stylesheet"
  href="https://cdn.jsdelivr.net/npm/bootstrap@5.2.3/dist/css/bootstrap.min.css"
  integrity="sha384-rbsA2VBKQhggwzxH7pPCaAqO46MgnOM80zW1RWuH61DGLwZJEdK2Kadq2F9CUG65"
  crossorigin="anonymous"
/>
// import { Container } from "react-boostrap";

const Planner3D = () => {
  const navigate = useNavigate();
    return (

      <div className="grid">
        <iframe src="https://planner5d.com/v?key=79e530c1a779b82338bbd76fe5467b5e&viewMode=3d" style="width:500px; height:960px; border:none;" allowfullscreen></iframe> 

        <button className='button' onClick={() => {navigate('/');}}> กลับ </button>
    </div>

    );
  }
  export default Planner3D;
